import React from 'react'
import calender from '../images/calendar.png'
import clock from '../images/clock.png';
 const Datetime = () => {
    return (
        <div className="datetime">
            <div className="date">
             <img src={calender}></img>
            </div>
            <div className="time">

            </div>
            
        </div>
    )
}
export default Datetime
